import React from "react";
import "./Book.css";
import {
  Card,
  ListGroup,
  ListGroupItem,
  Container,
  CardDeck,
  CardColumns
} from "react-bootstrap";

export const Book = () => (
  <div class="bookpage">
    <Container>
      <CardDeck>
        <Card>
          <Card.Img
            variant="top"
            src="https://images-na.ssl-images-amazon.com/images/I/41Fsv0QrBDL._AC_.jpg"
          ></Card.Img>
        </Card>
      </CardDeck>
    </Container>
  </div>
);
